/*CRIA A O DATABASE*/
create database if not exists RESILIA;

/*UTILIZA O DATABASE CRIADO*/
use RESILIA;

/*CRIA AS TABELAS*/
create table if not exists RESILIA.ALUNOS (
    matricula INT PRIMARY KEY AUTO_INCREMENT NOT null,
    aluno VARCHAR(255) NOT NULL,
    cpf VARCHAR(11) NOT NULL,
    dataNasc DATE,
    telefone VARCHAR(12),
    endereco VARCHAR(255)
);

create table if not exists RESILIA.DEPARTAMENTOS (
    idDepartamento INT PRIMARY KEY AUTO_INCREMENT NOT NULL,
    departamento VARCHAR(255) NOT NULL
);

create table if not exists RESILIA.FUNCIONARIO (
    idFuncionario INT PRIMARY KEY AUTO_INCREMENT NOT NULL,
    funcionario VARCHAR(255) NOT NULL,
    cargo VARCHAR(255) noT null,
    cpf VARCHAR(11) NOT NULL,
    dataNasc DATE,
    telefone VARCHAR(12),
    endereco VARCHAR(255),
    idDepartamento INT NOT NULL,
    CONSTRAINT fk_idDepart FOREIGN KEY (idDepartamento)
        REFERENCES RESILIA.DEPARTAMENTOS (idDepartamento)
);
create table if not exists RESILIA.CURSO (
    idCurso INT PRIMARY KEY AUTO_INCREMENT NOT NULL,
    curso VARCHAR(255) NOT NULL,
    turno VARCHAR(255) NOT NULL,
    qtdModulos INT NOT NULL
);
create table if not exists RESILIA.MODULOS (
    codModulo INT PRIMARY KEY AUTO_INCREMENT NOT NULL,
    modulo VARCHAR(255) NOT NULL,
    dataInicio DATE
);
create table if not exists RESILIA.ALUNOMODULO (
    codModulo INT NOT NULL,
    matricula INT NOT NULL,
    CONSTRAINT fk_CodMod FOREIGN KEY (codModulo)
        REFERENCES RESILIA.MODULOS (codModulo),
    CONSTRAINT fk_matricAlun FOREIGN KEY (matricula)
        REFERENCES RESILIA.ALUNOS (matricula)
);
create table if not exists RESILIA.ALUNOCURSO (
    matricula INT NOT NULL,
    idCurso INT NOT NULL,
    CONSTRAINT fk_Matric FOREIGN KEY (matricula)
        REFERENCES RESILIA.ALUNOS (matricula),
    CONSTRAINT fk_idCurso FOREIGN KEY (idCurso)
        REFERENCES RESILIA.CURSO (idCurso)
);
create table if not exists RESILIA.FACILITADORMODULO (
    idFuncionario INT NOT NULL,
    codModulo INT NOT NULL,
    CONSTRAINT fk_idFacilit FOREIGN KEY (idFuncionario)
        REFERENCES RESILIA.FUNCIONARIO (idFuncionario),
    CONSTRAINT fk_CursoId FOREIGN KEY (codModulo)
        REFERENCES RESILIA.MODULOS (codModulo)
);
create table if not exists RESILIA.ALUNONOTA (
    nota FLOAT NOT NULL,
	codModulo INT NOT NULL,
	matricula INT NOT NULL,
    CONSTRAINT fk_modNotaAlun FOREIGN KEY (codModulo)
        REFERENCES RESILIA.MODULOS (codModulo),
    CONSTRAINT fk_MatricNota FOREIGN KEY (matricula)
        REFERENCES RESILIA.ALUNOS (matricula)
);
create table if not exists RESILIA.PAGAMENTOS (
    Data_Venc DATE not null,
    Data_Pag DATE,
    statusPgto VARCHAR(255) NOT NULL,
    matricula INT NOT NULL,
    CONSTRAINT fk_MatricPag FOREIGN KEY (matricula)
        REFERENCES RESILIA.ALUNOS (matricula)
);
create table if not exists RESILIA.PRESENCA (
    data_Aula DATE,
    presenca BOOLEAN,
    matricula INT NOT NULL,
    CONSTRAINT fk_MatricPresenca FOREIGN KEY (matricula)
        REFERENCES RESILIA.ALUNOS (matricula)
);
create table if not exists  RESILIA.AVALIACAOFACILITADOR (
    avaliacao int NOT NULL,
    idFuncionario INT NOT NULL,
    codModulo INT NOT NULL,
    matricula INT NOT NULL,
    CONSTRAINT fk_modFacilit FOREIGN KEY (codModulo)
        REFERENCES RESILIA.MODULOS (codModulo),
    CONSTRAINT fk_avaliacaoFacilit FOREIGN KEY (idFuncionario)
        REFERENCES RESILIA.FUNCIONARIO (idFuncionario),
    CONSTRAINT fk_MatricAvalFac FOREIGN KEY (matricula)
        REFERENCES RESILIA.ALUNOS (matricula)
);


